import React, { Fragment } from "react";

const array = ["carlos", "kendall", "ariel"];

const P = () => {
  return (
    <Fragment>
      <h2>
        {array.map((el) => (
          <p>a</p>
        ))}
      </h2>
    </Fragment>
  );
};

export default P;
